import React from 'react'
import './card.css'
function Card() {
  return (
     <div className="col-lg-2 col-md-4 col-sm-6">
        <div className="movie-card">
            <img src="" alt="Preview" className='img-fluid'/>
        </div>
     </div>
  )
}

export default Card
